import React, { useState, useEffect } from 'react';
import TinderCard from 'react-tinder-card';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

function MatchList({ userId }) {
  const [matches, setMatches] = useState([]);
  const [error, setError] = useState('');
  const [bottomMessage, setBottomMessage] = useState('');
  const navigate = useNavigate();

  // Mapping of majors to cute animal emojis.
  const cuteAnimalEmojiMap = {
    "Electrical Engineering": "ðŸ­",
    "Mechanical Engineering": "ðŸ±",
    "Civil Engineering": "ðŸ¶",
    "Chemical Engineering": "ðŸ¹",
    "General Engineering": "ðŸ»",
    "Computer Science": "ðŸ¦Š"
  };

  // Returns a cute animal emoji based on the user's major.
  const getEngineerEmoji = (user) => {
    if (user.major && cuteAnimalEmojiMap[user.major]) {
      return cuteAnimalEmojiMap[user.major];
    }
    return "ðŸ±"; // default emoji
  };

  // Fetch matches from backend and ensure we have an array.
  const fetchMatches = () => {
    axios.get(`/api/matches/find/${userId}`)
      .then(response => {
        if (Array.isArray(response.data)) {
          setMatches(response.data);
          setError('');
        } else {
          setMatches([]);
          setError(response.data);
        }
      })
      .catch(err => {
        setError(err.response?.data || 'Error fetching matches');
        setMatches([]);
      });
  };

  useEffect(() => {
    if (userId) fetchMatches();
  }, [userId]);

  // Get username from user.
  const getUsername = (user) => {
    return user.name && user.name.trim() !== "" ? user.name : user.email.split('@')[0];
  };

  // onSwipe callback.
  const onSwipe = (direction, matchUserId) => {
    if (direction === 'right') {
      axios.post(`/api/matches/swipe?user1Id=${userId}&user2Id=${matchUserId}`)
        .then(response => {
          // Always remove the card.
          setMatches(prev => Array.isArray(prev) ? prev.filter(match => match.user.id !== matchUserId) : prev);
          // If a message is returned, update bottomMessage.
          if (response.data && response.data.message) {
            setBottomMessage(response.data.message);
          } else {
            setBottomMessage('');
          }
        })
        .catch(err => {
          // Remove the card and update bottomMessage even if there is an error.
          setMatches(prev => Array.isArray(prev) ? prev.filter(match => match.user.id !== matchUserId) : prev);
          setBottomMessage(err.response?.data || 'Error processing swipe.');
        });
    } else if (direction === 'left') {
      // For a left swipe, remove the card and clear any message.
      setMatches(prev => Array.isArray(prev) ? prev.filter(match => match.user.id !== matchUserId) : prev);
      setBottomMessage('');
    }
  };

  const onCardLeftScreen = (matchUserId) => {
    console.log(`Card for user ${matchUserId} left the screen`);
  };

  return (
    <div className="container match-list-container">
      <h2 className="match-list-header">Match List</h2>
      <div className="match-list-update" style={{ textAlign: 'center', marginBottom: '1rem' }}>
        <button className="btn" onClick={() => navigate('/update')}>Update Preference</button>
      </div>
      {error && (
        <p className="error" style={{ textAlign: 'center' }}>
          {typeof error === 'object' ? JSON.stringify(error) : error}
        </p>
      )}
      <div className="match-list-cards">
        {Array.isArray(matches) && matches.length > 0 ? (
          matches.map((match) => (
            <TinderCard
              key={match.user.id}
              onSwipe={(dir) => onSwipe(dir, match.user.id)}
              onCardLeftScreen={() => onCardLeftScreen(match.user.id)}
              preventSwipe={[]} // Allow swiping in all directions
            >
              <div className="tinder-card">
                <div className="tinder-card-image">
                  <span className="tinder-card-emoji">{getEngineerEmoji(match.user)}</span>
                </div>
                <div className="tinder-card-text">
                  <h3 className="tinder-card-username">{getUsername(match.user)}</h3>
                  <p><strong>Common Days:</strong> {match.commonDays.join(', ')}</p>
                  <p><strong>Common Subjects:</strong> {match.commonSubjects.join(', ')}</p>
                  <div className="tinder-card-buttons" style={{ textAlign: 'center', marginTop: '1rem' }}>
                    <button className="btn" onClick={() => onSwipe('left', match.user.id)}>Swipe Left</button>
                    <button className="btn" onClick={() => onSwipe('right', match.user.id)}>Swipe Right</button>
                  </div>
                </div>
              </div>
            </TinderCard>
          ))
        ) : (
          <p style={{ textAlign: 'center' }}>
            {Array.isArray(matches) ? "No matches available." : matches}
          </p>
        )}
      </div>
      {bottomMessage && (
        <p className="error" style={{ textAlign: 'center', marginTop: '1rem' }}>
          {bottomMessage}
        </p>
      )}
    </div>
  );
}

export default MatchList;
